import React from "react";
import { Routes, Route, Link, useLocation, useNavigate } from "react-router-dom";
import Navbar from "./Navbar";
import "../assets/css/Dashboard.css";
import ExpenseTracking from "./ExpenseTracking";
import IncomeManagement from "./IncomeManagement";
import BudgetAllocation from "./BudgetAllocation";
import Reports from "./Reports";
import Settings from "./Settings";
import MyPocketAI from "./MyPocketAI";
import { useAuth } from "../context/AuthContext";

function Dashboard() {
  const { logout, user } = useAuth();
  const location = useLocation();
  const navigate = useNavigate();

  const handleLogout = () => {
    logout();
    navigate("/login");
  };

  return (
    <div className="App-dashboard">
      <Navbar />
      <div className="dashboard-content">
        <div className="dashboard-sidebar">
          <div className="userdata">
            <p>Name: <span>{user?.name || "Anonymous"}</span></p>
            <p>Email: <span>{user?.email || "N/A"}</span></p>
          </div>
          <ul className="dashboard-menu">
            <li className={location.pathname.includes("expense-tracking") ? "active" : ""}>
              <Link to="/dashboard/expense-tracking">💰 Expense Tracking</Link>
            </li>
            <li className={location.pathname.includes("income-management") ? "active" : ""}>
              <Link to="/dashboard/income-management">📈 Income Management</Link>
            </li>
            <li className={location.pathname.includes("budget-allocation") ? "active" : ""}>
              <Link to="/dashboard/budget-allocation">📊 Budget Allocation</Link>
            </li>
            <li className={location.pathname.includes("reports") ? "active" : ""}>
              <Link to="/dashboard/reports">📜 Reports & Insights</Link>
            </li>
            <li className={location.pathname.includes("ai-assistance") ? "active" : ""}>
              <Link to="/dashboard/ai-assistance">🤖 My Pocket AI</Link>
            </li>
            <li className={location.pathname.includes("settings") ? "active" : ""}>
              <Link to="/dashboard/settings">⚙️ Settings</Link>
            </li>
            <li>
              <button onClick={handleLogout} className="logout-button">🚪 Logout</button>
            </li>
          </ul>
        </div>

        <div className="dashboard-main">
          <Routes>
            <Route index element={<Reports />} />
            <Route path="/expense-tracking" element={<ExpenseTracking />} />
            <Route path="/income-management" element={<IncomeManagement />} />
            <Route path="/budget-allocation" element={<BudgetAllocation />} />
            <Route path="/reports" element={<Reports />} />
            <Route path="/ai-assistance" element={<MyPocketAI />} />
            <Route path="/settings" element={<Settings />} />
          </Routes>
        </div>
      </div>
    </div>
  );
}

export default Dashboard;
